import './Register.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/css/bootstrap.css';
import { Card, Form, Button } from 'react-bootstrap';
const Login = () => {
    
    const handleLogginButtonClick = () => {
        setRegister(null);
      };

    return (
        <div className="register-container">
        <Card className="register-card">
          <Card.Body>
            <Card.Title>Register</Card.Title>
            <Form>
                <Form.Group controlId="formUsername">
                <Form.Label>Enter your accounts username</Form.Label>
                <Form.Control type="text" placeholder="Enter your new username" />
                </Form.Group>

                <Form.Group controlId="formPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Enter your password" />
                </Form.Group>
        
                <Button variant="primary" type="button">
                Register
                </Button>

                <Button variant="secondary" type="submit" onClick={handleLogginButtonClick}>
                Already have an account
                </Button>

            </Form>
          </Card.Body>
        </Card>
      </div>
    );
  };
  
  export default Login;
